import React, { Children } from 'react';
import Link from 'next/link'

const NavLink = () => {
  return (
    <Link href={href}>
      <a>{Children}</a>
    </Link>

  )
}

const NavBar = () => {
  return (
    <div className="bg-gray-500 py-4">
      <NavLink href="/Sobre">Sobre</NavLink>

      <Link href="/Cadastro">
        <a>Cadastro</a>
      </Link>

      <Link href="/Entrar">
        <a>Entrar</a>
      </Link>
    </div>
  )
};

export default NavBar;
